  cd "$old_pwd"
else
cd "$prg_dir"/.


gunzip -V  > /dev/null 2>&1
if [ "$?" -ne "0" ]; then
  echo "Sorry, but I could not find gunzip in path. Aborting."
  exit 1
fi

  if [ -d "$INSTALL4J_TEMP" ]; then
     sfx_dir_name="$INSTALL4J_TEMP/${progname}.$$.dir"
