cd "$sfx_dir_name"
sfx_dir_name=`pwd`
trap 'cd "$old_pwd"; rm -R -f "$sfx_dir_name"; exit 1' HUP INT QUIT TERM
tail -c 1668113 "$prg_dir/${progname}" > sfx_archive.tar.gz 2> /dev/null
if [ "$?" -ne "0" ]; then
  tail -1668113c "$prg_dir/${progname}" > sfx_archive.tar.gz 2> /dev/null
